In TypeORM, you can use the `json` or `jsonb` data type to store JSON data in a PostgreSQL database. Here's how you can define it in your TypeORM entity:

```typescript
import { Entity, PrimaryGeneratedColumn, Column } from "typeorm";

@Entity()
export class MyEntity {

    @PrimaryGeneratedColumn()
    id: number;

    @Column({ type: "json" }) // or "jsonb"
    data: any;
}
```

The difference between `json` and `jsonb` is that `jsonb` supports indexing, which can lead to more efficient searches, but it may use more storage space. If you don't need to index the JSON data, `json` is a good choice. If you do need to index the data, `jsonb` is the way to go.

