Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read.textFile("onsite_data.txt").javaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read.textFile("top_queries.txt").javaRDD()

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, Long] = Map()

    // Process onsite data
    val hitRate = onsiteData.map(new Function[String, (String, Boolean)] {
      override def call(line: String): (String, Boolean) = {
        val Array(query, timestamp) = line.split(" ")
        if (broadcastTopQueries.value.contains(query)) {
          val cacheTime = cache.getOrElse(query, 0L)
          if (cacheTime == 0L || (System.currentTimeMillis() - cacheTime) > 12 * 60 * 60 * 1000) {
            // Cache miss, update cache
            cache.put(query, System.currentTimeMillis())
            (query, false)
          } else {
            // Cache hit
            (query, true)
          }
        } else {
          // Query not in top queries
          (query, false)
        }
      }
    }).filter(_._2).count() / onsiteData.count().toDouble

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top queries to all nodes in the cluster. The cache is initialized as an empty mutable map.

The job then processes the onsite data by mapping each line to a tuple containing the query and a boolean indicating whether it was a cache hit or miss. If the query is in the top queries and it's the first time the system has seen it, or if it's been more than 12 hours since the last time it was seen, the system sends a request to retrieve the query and caches it in memory. The next time the same query comes, it will be a cache hit.

Finally, the job calculates the hit rate by dividing the number of cache hits by the total number of queries in the onsite data.

